package com.bjgt.ms.util;

public class Snippet {
	/**
	 * 十六进制的字符串转换为byte数组
	 * **/
	public static byte[] conver16HexToByte(String hex16Str) {
		char[] c = hex16Str.toCharArray();
		byte[] b = new byte[c.length / 2];
		for (int i = 0; i < b.length; i++) {
			int pos = i * 2;
			int a = "0123456789ABCDEF".indexOf(c[pos]) << 4;
			int aa = "0123456789ABCDEF".indexOf(c[pos + 1]);
			b[i] = (byte) (a | aa);
		}
		return b;
	}

	public static void main(String[] args) {
		String s = "";
		byte[] b = conver16HexToByte(s);
		FileUtil.byte2File(b, "E:", "22.jpg");
	}
}
